車内の空気を新車のような空間へ！車のエアコンは女性でも交換できるのをご存知ですか？BOSCHテクノロジーの集大成のエアコンフィルターと女性でも簡単にできる交換方法をご紹介致します。◎脱臭：特殊高性能活性炭が周期成分を吸着、脱臭します。◎除塵：高性能合成繊維不織布、および帯電超極細不織布を採用！花粉の侵入をしっかりブロック！◎抗菌・防カビ：フィルター表面の菌・カビの繁殖を抑制し、クリーンな空気を車内へ供給します。◎植物由来のポリフェノールを採用した抗ウィルス機能・アレル物質抑制機能を追加！●エアコンフィルターの交換推奨時期は走行距離10000kmまたは1年です。<br><br>【交換難易度：　☆☆】　　☆：場合により工具必要　☆☆：工具必要、交換作業にやや時間がかかる　☆☆☆：工具、および技能が必要<br><br>※必ず適合（車種、年式、形式等）をご確認の上お買い求めください。※作業手順は例であり、実写と異なる場合があります。※製品に同梱されている取扱説明書の「取付・使用上の注意事項」をお読みください。※使用済のエアコンフィルターを清掃して再利用することは出来ません.<br><br><br>対応車種：ダイハツ ブーン 18.03-22.02 M312S 標準装備 エアコン装備車<br><br>エレメント・フィルター ｜ エアコンフィルター<br>ダイハツ | ブーン | M300系<tr><td colspan="2">
